            if (profile._DomainSuffixOption.IsSet)
                if (profile.DomainSuffix != null)
                    writer.WriteString("domainSuffix", profile.DomainSuffix);

            if (profile._EapOption.IsSet)
                if (profile.Eap != null)
                    writer.WriteString("eap", profile.Eap);

            if (profile._EapCaCertOption.IsSet)
            {
                writer.WritePropertyName("eapCaCert");
                JsonSerializer.Serialize(writer, profile.EapCaCert, jsonSerializerOptions);
            }
            if (profile._EapClientCertOption.IsSet)
            {
                writer.WritePropertyName("eapClientCert");
                JsonSerializer.Serialize(writer, profile.EapClientCert, jsonSerializerOptions);
            }
            if (profile._EapClientKeyOption.IsSet)
            {
                writer.WritePropertyName("eapClientKey");
                JsonSerializer.Serialize(writer, profile.EapClientKey, jsonSerializerOptions);
            }
            if (profile._EapClientPwdOption.IsSet)
                if (profile.EapClientPwd != null)
                    writer.WriteString("eapClientPwd", profile.EapClientPwd);

            if (profile._EapIdentityOption.IsSet)
                if (profile.EapIdentity != null)
                    writer.WriteString("eapIdentity", profile.EapIdentity);

            if (profile._EapIntermediateCertOption.IsSet)
            {
                writer.WritePropertyName("eapIntermediateCert");
                JsonSerializer.Serialize(writer, profile.EapIntermediateCert, jsonSerializerOptions);
            }
            if (profile._EapPwdOption.IsSet)
                if (profile.EapPwd != null)
                    writer.WriteString("eapPwd", profile.EapPwd);

            if (profile._HiddenSsidOption.IsSet)
                writer.WriteBoolean("hiddenSsid", profile._HiddenSsidOption.Value!.Value);

            if (profile._NameOption.IsSet)
                if (profile.Name != null)
                    writer.WriteString("name", profile.Name);

            if (profile._PskOption.IsSet)
                if (profile.Psk != null)
                    writer.WriteString("psk", profile.Psk);
        }
    }
